import { Link } from "react-router-dom";

function NavBar() {
  return (
    <header>
      <div>React meet ups</div>
      <nav>
        <li>
          <Link to="/">All meet ups</Link>
        </li>
        <li>
          <Link to="/new-meetup">New meet up</Link>
        </li>
        <li>
          <Link to="/favorites">Favorites</Link>
        </li>
      </nav>
    </header>
  );
}

export default NavBar;
